import React from "react"

let WhoWeHelp_Pagination = ({postsPerPage, totalPosts}) =>{
    let pageNumber = [];

    for(let i = 1; i <= Math.ceil(totalPosts / postsPerPage); i++){
        pageNumber.push[i]
    }
    return(
      <>
            <ul>
                {pageNumber.map(function(el){
                    <li>
                        <a>{el}</a>
                    </li>
                })}
            </ul>
      </>
    )
}


export default WhoWeHelp_Pagination
